import {CubeTransition} from 'react-3d-cube-transition'
import 'react-3d-cube-transition/dist/index.css'
import logo from './logo.svg';
import './App.css';
import Nav from './Nav.js'
import Banner from './Banner';
import About from './About';

function App() {
  return (
    <div className="App">
      {/* <Nav/> */}
      <CubeTransition 
              frontPage= { <Banner/> }
              rightPage={ <About/> }
              contentElevation={ 15 }
              buttons
            />
      {/* <Work/>
      <Contact/> */}

    </div>
  );
}

export default App;
